INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "青空の下で謁見", 40, 7, "ペコリーヌとの出会い", "フリーマーケット会場", 5118061, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 2834, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "未来の騎空団\nマスコット？", 40, 7, "マホとの出会い", "フリーマーケット会場", 5118062, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 2835, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "お嬢さまからの\n緊急依頼", 40, 7, "アキノとの出会い", "ランドソル市街地", 5118063, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 2837, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "黄金色の悩みごと", 40, 18, "ジュンとの出会い", "フリーマーケット会場", 5118064, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 4108402, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "白熱！　格闘大会！", 40, 18, "カオリとの出会い", "フリーマーケット会場", 5118065, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 4107402, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "祭り太鼓はオーエドの華", 40, 16, "ニノンとの出会い", "オーエド町", 5118066, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 9000227, 2, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "人気者は遅れて\nやってくる", 40, 19, "スズナとの出会い", "フリーマーケット会場", 5118067, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 2101181, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "巫女・ミーツ・魔法少女", 40, 18, "ナナカとの出会い", "ランドソル市街地", 5118068, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 4109402, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "ネズ耳は二度なくなる", 40, 18, "キャル＆コッコロとの出会い", "フリーマーケット会場", 5118069, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 4305402, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "この出会いにカンパイ！", 40, 18, "ユカリとの出会い", "ランドソル市街地", 5118070, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 4101402, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "陰陽アンサンブル", 40, 18, "アオイとの出会い", "ランドソル市街地", 5118071, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 4106402, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "運試し十番勝負！", 40, 7, "シノブとの出会い", "フリーマーケット会場", 5118072, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 2836, 3, 8, 1);
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (10118, 20063115, "彼女たちの新たな日常", 0, 0, "オープニング", 0, 5118600, 0, 0, 0, 0, 1, 0, 0);
